import Master from './../../layouts/Master'
import React from "react";

class Article extends React.Component {
    render() {
        return (
            <Master>
                <section className="section-content bg padding-y">
                    <div className="container">
                        <div className="row">
                            <div className=""></div>   
                        </div>
                    </div>
                </section>
            </Master>
        )
    }
}
export default Article;
